import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './Header';
import TinderCards from './TinderCards';

function App() {
  return (
    <div className="App">

        <Header />
      <BrowserRouter>
        <Routes>
          <Route path='/chat' element={<h1>Hello World</h1>} />
          <Route path="/" element={<TinderCards />} />
        </Routes>
    </BrowserRouter>

    </div>
  );
}

export default App;
